import searchApi from '../../Api';



const Search = () => {
    return (

        <div className='p-4 mx-5 d-flex row justify-content-center'> 
            <div className="col-1"></div>
            <div className='col-7'>            
                <input type="search" id="searchBar" className="form-control rounded" placeholder="Search"/>
            </div>
            <div className="col-1">
            <button type="button" className="btn btn-dark mx-1" id="searchButton">
                <i className="fa px-1 fa-search fax-3"></i>
            </button>
            </div>
        </div>
    )
}

export const searchBar = document.getElementById("searchBar");
export const searchButton = document.getElementById("searchButton");
export default Search;
